import Modal from "../modules/modals/components/Modal";
import ModalBody from "../modules/modals/components/ModalBody";
import ModalHeader from "../modules/modals/components/ModalHeader";
import ModalFooter from "../modules/modals/components/ModalFooter";
import Select from 'react-select'

const options = [
  { value: 'bug', label: 'Bug' },
  { value: 'feature', label: 'Feature' },
  { value: 'request', label: 'Request' }
];

export default function NewColumnModal({close, category, setCategory, title, setTitle, currentColumnId, createTicket}) {
  return (
    <Modal>
      <ModalHeader>
        <h3>Test Modal #1</h3>
      </ModalHeader>
      <ModalBody>
      <Select  value= {category} onChange={(value)=>setCategory(value) }/>
        <input value={title} onChange= {e=> setTitle(e.target.value)}></input>
        
      </ModalBody>
      <ModalFooter>
      <button onClick={()=>createTicket(currentColumnId)}>Create Ticket</button>
      </ModalFooter>
    </Modal>
  );
}
